import Head from 'next/head';
import Navbar from './NavBar';

const Layout = (props) => (
  <div>
    <link rel="stylesheet" href="https://bootswatch.com/4/cerulean/bootstrap.min.css"/>
    <Navbar/>
    <div className="container">
      {props.children}
    </div>
  </div>
);

export default Layout;
